    fetch(`${fetchURL}jokes/random/5`)
      .then((res) => res.json())

  useEffect(() => {
    getData().then((data) => setData(data))
  }, []);


  return (
    <div>
      <table>
        {this.state.orderDetails.map((item =>
        <tr key={item.OrderID}>{item.CustomerID}</tr>
        ))}
    </table>
      
      {console.log(data.value)}
    


    </div>

  );
}

export default Search;
